import React from "react";
import "./MarketplaceHeader.css";
import { Link } from "react-router-dom";

export default function MarketplaceHeader() {
  return (
    <section className="row marketplaceheader">
      <Link to="/custheader/marketplaceheader/sell" className="card-container">
        <div className="login-card admin-card">
          <h2>Sell Waste</h2>
          <p>Sell your waste in the open market.</p>
        </div>
      </Link>
      <Link to="buy" className="card-container">
        <div className="login-card admin-card">
          <h2>Buy Waste</h2>
          <p>Buy waste from the open market.</p>
        </div>
      </Link>
    </section>
  );
}
